export default function Pokemon ({id, name, image, type}){

    return(
        <div>
            <h4>    
                {id}
            </h4>
            <h3>
                {name}
            </h3>
            <img src={image} alt={name}></img>
            <h5>
                {type[0]}
            </h5>
            <h5>
                {type[1]}
            </h5>
        </div>
    )
}
